import React from 'react';
import Item from './Item.js'

const ListItems = ({itemsArr}) => {
    const itemComponent = itemsArr.map(i => {
        return (
            <Item key={this.i} itemValue={itemsArr[this.i]}/>
        )
    })
    return (
        <div>
            {itemComponent}
        </div>
    )
}

export default ListItems;
